import React from 'react'
import { Container } from '@material-ui/core';
import Grid from '@material-ui/core/Grid';

function About() {
    return (
        <Container>
            <Grid container spacing={3}>
                <Grid item xs={12} lg={4} >
                    <h2>yo</h2>
                </Grid>
                <Grid item xs={12} lg={8} >
                    <h6>Bo</h6>
                </Grid>
            </Grid>
        </Container>
    )
}

export default About
